INSERT INTO `interview_questions` (`quest_id`, `question`, `Category`, `suggested_answer`, `instruction`) VALUES
(2, 'Tell us about yourself.', 'Basic', 'I was born in ________ to a family consisting mostly of teachers. I\'m a hard-working individual with a winning mentality and I always look for creative solutions to difficult challenges.', 'Focus more on talking about your achievements and learning and keep it short.'),
(3, 'What are your strengths?', 'Basic', 'I am very good at mathematics and anything numbers-related. This is why I started to get into coding and I am already a fairly experienced Node JS backend developer.', 'Share your strengths related to the job. You can also state that you are a quick learner and highly motivated individual.'),
(4, 'What are your weaknesses?', 'Basic', 'I sometimes have difficulties with time management and I end up spending much of my personal time working or studying. However, this is something that I constantly work on, with better results each day.\r\n\r\n', 'Always choose a weakness that doesnt impact your current job role.  Never brag about the strengths and skills that you cannot justify.'),
(5, 'Out of all candidates, why should we hire you?', 'Basic', 'I am very good with numbers and have an almost obsessive attention to detail, so I think I am very well-suited for the role of junior accountant at your company.\r\n\r\n', 'Share strengths and skills that are relevant for the job description, but keep it short. You can even share some more examples of how you managed a few projects or important assignments in your college that reflect your strengths.'),
(6, 'Where do you see yourself five years from now?', 'Basic', 'Five years from now I hope to be a successful sales professional working for your company. I believe this job can help me improve my skills and kickstart my career.\r\n', 'Never give an impression that you want this job just to gain experience and then you wish for something bigger in near future. Keep your answer aligned with the current job role to show your interest in the company.\r\n'),
(7, 'How did you learn about the opening?', 'Basic', 'I heard about it from an old colleague. He informed me knowing my interest to work here.', 'Show that you know about the job because you want to work there. Employers don\'t want to hire people who just want a job; they want to hire people who want a job with their company.'),
(8, 'What do you like to do outside of work?', 'Basic', 'I usually like to spend my time learning something new. I really like reading books upon developing social skills and on interaction with people.', 'Focus on activities that indicate some sort of growth: skills you\'re trying to learn, goals you\'re trying to accomplish. \r\n'),
(9, 'Why do you want to work in this industry?', 'Advanced', 'I want to contribute positively to an industry I feel so passionate about, and to help promote a product I really believe in. I feel that I have the required abilities and potential to make a difference from others.\r\n', 'Dont just say you like it. Focus instead on your history with that particular industry, and if you can, tell a success story.'),
(10, 'What do you think of your previous boss?', 'Advanced', 'My last boss taught me the importance of time management  he didnt pull any punches, and was extremely deadline-driven. His attitude pushed me to work harder, and to meet deadlines I never even thought were possible.', 'Instead of trashing your former employer, stay positive, and focus on what you learned from him (no matter how awful he really was)'),
(11, 'Why do you want to work in our company?', 'Advanced', 'Your company has always been forward-focused and used technology to help improve the customer experience, and Im looking for an opportunity where I can put my passion for great UX to work.', 'Try stating some positive attributes of the company. Include their previous success stories as examples.\r\n'),
(12, 'Do you have any regrets?', 'Advanced', 'I do always wish I had known what I wanted to do very early on in my career. However, I learned skills in my previous career that I wouldnt have otherwise learned that help my in me in my job today.', 'Be sure to let them know that you have made mistakes, you have learned from them to become better. Do not state anything that makes you less worthy for the position.\r\n'),
(13, 'How would you deal with a conflict with a co-worker?', 'Advanced', 'When I have a disagreement with a co-worker, I always pull the person aside and discuss the issue privately. I listen actively to make sure I understand the other persons point of view, and I work with the person to develop a solution together.', 'Try to convince them that you are co-operative, understanding, and respectful towards other team members.'),
(14, 'A snail is at the bottom of a 30-foot well. Each day he climbs up three feet, but at night he slips back two feet. How many days will it take him to climb out of the well?', 'Advanced', 'Well, I cant claim an exact answer to the question but if the snail climbs up three feet a day and slips back two feet then it covers a distance of one foot each day. It can take up to 30 days for him to climb up the well.', 'Dont go for an exact answer. Show your problem solving-skill and be ready for failure.');

